float mean_absolute_deviation(vector<float> numbers) {
    if (numbers.empty()) {
        // Handle the edge case where the input vector is empty
        return 0.0f; // or throw an exception, depending on the requirements
    }

    // Step 1: Calculate the mean of the dataset
    float sum = accumulate(numbers.begin(), numbers.end(), 0.0f);
    float mean = sum / numbers.size();

    // Step 2: Calculate the absolute differences
    float absolute_differences_sum = 0.0f;
    for (float number : numbers) {
        absolute_differences_sum += abs(number - mean);
    }

    // Step 3: Compute the Mean Absolute Deviation
    float mad = absolute_differences_sum / numbers.size();

    // Step 4: Return the result
    return mad;
}

