#include <string>
using namespace std;

bool is_palindrome(string str) {
    // Test if given string is a palindrome
    string s(str.rbegin(), str.rend());
    return s == str;
}

string find_longest_palindromic_suffix(string str) {
    // Find the longest suffix of str that is a palindrome
    for (int i = 0; i < str.length(); ++i) {
        string suffix = str.substr(i);
        if (is_palindrome(suffix)) {
            return suffix;
        }
    }
    return "";
}

string make_palindrome(string str) {
    // Find the shortest palindrome that begins with the supplied string
    string longest_palindromic_suffix = find_longest_palindromic_suffix(str);
    string prefix = str.substr(0, str.length() - longest_palindromic_suffix.length());
    string reversed_prefix(prefix.rbegin(), prefix.rend());
    return str + reversed_prefix;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (make_palindrome("") == "");
    assert (make_palindrome("x") == "x");
     assert (make_palindrome("xyz") == "xyzyx");
     assert (make_palindrome("xyx") == "xyx") ;
     assert (make_palindrome("jerry") == "jerryrrej");
}

