vector<int> parse_music(string music_string) {
    vector<int> beats;
    string current_note = "";

    for (char c : music_string) {
        if (c == ' ') {
            // Process the current note
            if (current_note == "o") {
                beats.push_back(4);
            } else if (current_note == "o|") {
                beats.push_back(2);
            } else if (current_note == ".|") {
                beats.push_back(1);
            }
            // Reset current_note
            current_note = "";
        } else {
            // Accumulate characters for the current note
            current_note += c;
        }
    }

    // Process the last note if the string does not end with a space
    if (!current_note.empty()) {
        if (current_note == "o") {
            beats.push_back(4);
        } else if (current_note == "o|") {
            beats.push_back(2);
        } else if (current_note == ".|") {
            beats.push_back(1);
        }
    }

    return beats;
}

