    // Step 2: Find the Minimum and Maximum Values
    float min_value = *min_element(numbers.begin(), numbers.end());
    float max_value = *max_element(numbers.begin(), numbers.end());

    // Step 3: Compute the Scaling Factor
    float scale_factor = max_value - min_value;

    // Step 4: Apply the Linear Transformation
    vector<float> rescaled_numbers;
    for (float num : numbers) {
        float transformed_value = (num - min_value) / scale_factor;
        rescaled_numbers.push_back(transformed_value);
    }

    // Step 5: Return the Transformed Vector
    return rescaled_numbers;
}

