vector<float> rescale_to_unit(vector<float> numbers) {
    if (numbers.size() < 2) {
        throw invalid_argument("The input vector must contain at least two elements.");
    }

    float min_val = *min_element(numbers.begin(), numbers.end());
    float max_val = *max_element(numbers.begin(), numbers.end());
    float range = max_val - min_val;

    if (range == 0) {
        // Handle the case where all elements are the same
        return vector<float>(numbers.size(), 0.0);
    }

    vector<float> rescaled_numbers;
    rescaled_numbers.reserve(numbers.size());

    for (float num : numbers) {
        rescaled_numbers.push_back((num - min_val) / range);
    }

    return rescaled_numbers;
}

