string sort_numbers(string numbers) {
    // Step 3: Mapping Words to Numbers
    map<string, int> wordToNum = {
        {"zero", 0}, {"one", 1}, {"two", 2}, {"three", 3}, {"four", 4},
        {"five", 5}, {"six", 6}, {"seven", 7}, {"eight", 8}, {"nine", 9}
    };

    // Step 5: Mapping Numbers Back to Words
    map<int, string> numToWord = {
        {0, "zero"}, {1, "one"}, {2, "two"}, {3, "three"}, {4, "four"},
        {5, "five"}, {6, "six"}, {7, "seven"}, {8, "eight"}, {9, "nine"}
    };

    // Step 2: Tokenization
    vector<string> tokens;
    stringstream ss(numbers);
    string token;
    while (ss >> token) {
        tokens.push_back(token);
    }

    // Step 4: Sorting
    vector<int> nums;
    for (const string& word : tokens) {
        if (wordToNum.find(word) != wordToNum.end()) {
            nums.push_back(wordToNum[word]);
        }
    }
    sort(nums.begin(), nums.end());

    // Step 6: Output Generation
    vector<string> sortedWords;
    for (int num : nums) {
        sortedWords.push_back(numToWord[num]);
    }

    string result;
    for (size_t i = 0; i < sortedWords.size(); ++i) {
        result += sortedWords[i];
        if (i < sortedWords.size() - 1) {
            result += " ";
        }
    }

    return result;
}

