// Step 1: Define the mapping
map<string, int> numberMap = {
    {"zero", 0}, {"one", 1}, {"two", 2}, {"three", 3}, {"four", 4},
    {"five", 5}, {"six", 6}, {"seven", 7}, {"eight", 8}, {"nine", 9}
};

// Step 2: Input validation function
bool isValidInput(const string& input) {
    istringstream stream(input);
    string word;
    while (stream >> word) {
        if (numberMap.find(word) == numberMap.end()) {
            return false;
        }
    }
    return true;
}

// Step 3: Splitting function
vector<string> splitString(const string& input) {
    vector<string> words;
    istringstream stream(input);
    string word;
    while (stream >> word) {
        words.push_back(word);
    }
    return words;
}

// Step 4: Sorting function
vector<string> sortWords(const vector<string>& words) {
    vector<int> numbers;
    for (const auto& word : words) {
        numbers.push_back(numberMap[word]);
    }
    sort(numbers.begin(), numbers.end());

    vector<string> sortedWords;
    for (const auto& num : numbers) {
        for (const auto& pair : numberMap) {
            if (pair.second == num) {
                sortedWords.push_back(pair.first);
                break;
            }
        }
    }
    return sortedWords;
}

// Step 5: Main function
string sort_numbers(string numbers) {
    if (!isValidInput(numbers)) {
        return "Invalid input";
    }

    vector<string> words = splitString(numbers);
    vector<string> sortedWords = sortWords(words);

    ostringstream result;
    for (size_t i = 0; i < sortedWords.size(); ++i) {
        if (i != 0) {
            result << " ";
        }
        result << sortedWords[i];
    }

    return result.str();
}

