using namespace std;

string sort_numbers(string numbers) {
    // Step 1: Define the mapping
    map<string, int> numeral_to_int = {
        {"zero", 0}, {"one", 1}, {"two", 2}, {"three", 3}, {"four", 4},
        {"five", 5}, {"six", 6}, {"seven", 7}, {"eight", 8}, {"nine", 9}
    };

    // Step 2: Input Validation (simplified for brevity)
    // (Assume input is always valid for this example)

    // Step 3: Parse the Input String
    vector<string> numeral_words;
    istringstream iss(numbers);
    string word;
    while (iss >> word) {
        numeral_words.push_back(word);
    }

    // Step 4: Convert Numerals to Integers
    vector<int> int_values;
    for (const string& numeral : numeral_words) {
        int_values.push_back(numeral_to_int[numeral]);
    }

    // Step 5: Sort the Integers
    sort(int_values.begin(), int_values.end());

    // Step 6: Convert Integers Back to Numerals
    vector<string> sorted_numerals;
    for (int value : int_values) {
        for (const auto& pair : numeral_to_int) {
            if (pair.second == value) {
                sorted_numerals.push_back(pair.first);
                break;
            }
        }
    }

    // Step 7: Reconstruct the Output String
    ostringstream oss;
    for (size_t i = 0; i < sorted_numerals.size(); ++i) {
        if (i != 0) {
            oss << " ";
        }
        oss << sorted_numerals[i];
    }

    // Step 8: Return the Result
    return oss.str();
}

