    }

    // Step 3: Convert words to numbers
    vector<int> nums;
    for (const string& w : words) {
        nums.push_back(wordToNumber[w]);
    }

    // Step 4: Sort the numbers
    sort(nums.begin(), nums.end());

    // Step 5: Convert numbers back to words
    map<int, string> numberToWord = {
        {0, "zero"}, {1, "one"}, {2, "two"}, {3, "three"}, {4, "four"},
        {5, "five"}, {6, "six"}, {7, "seven"}, {8, "eight"}, {9, "nine"}
    };

    vector<string> sortedWords;
    for (int num : nums) {
        sortedWords.push_back(numberToWord[num]);
    }

    // Step 6: Reconstruct the output string
    ostringstream oss;
    for (size_t i = 0; i < sortedWords.size(); ++i) {
        if (i != 0) {
            oss << " ";
        }
        oss << sortedWords[i];
    }

    // Step 7: Return the result
    return oss.str();
}

