        int_values.push_back(numeral_to_int[numeral]);
    }

    // Step 4: Sort the integer values
    sort(int_values.begin(), int_values.end());

    // Step 5: Convert integers back to numerals
    vector<string> sorted_numerals;
    for (int value : int_values) {
        for (const auto& pair : numeral_to_int) {
            if (pair.second == value) {
                sorted_numerals.push_back(pair.first);
                break;
            }
        }
    }

    // Step 6: Construct the output string
    string result;
    for (size_t i = 0; i < sorted_numerals.size(); ++i) {
        result += sorted_numerals[i];
        if (i < sorted_numerals.size() - 1) {
