using namespace std;

double poly(const vector<double>& xs, double x) {
    double sum = 0;
    for (size_t i = 0; i < xs.size(); ++i) {
        sum += xs[i] * pow(x, i);
    }
    return sum;
}

double derivative(const vector<double>& xs, double x) {
    double sum = 0;
    for (size_t i = 1; i < xs.size(); ++i) {
        sum += xs[i] * i * pow(x, i - 1);
    }
    return sum;
}

double find_zero(const vector<double>& xs) {
    if (xs.size() % 2 != 0) {
        throw invalid_argument("The number of coefficients must be even.");
    }

    double max_coeff = 0;
    for (double coeff : xs) {
        if (abs(coeff) > max_coeff) {
            max_coeff = abs(coeff);
        }
    }
    if (max_coeff == 0) {
        throw invalid_argument("The largest non-zero coefficient must be non-zero.");
    }

    // Newton-Raphson Method
    double x0 = 0; // Initial guess
    double tolerance = 1e-7;
    double x1;
    do {
        x1 = x0 - poly(xs, x0) / derivative(xs, x0);
        if (abs(x1 - x0) < tolerance) {
            break;
        }
        x0 = x1;
    } while (true);

    return x1;
}


