#include<string>
using namespace std;

bool is_palindrome(string text) {
    if (text.empty()) {
        return true;
    }
    int left = 0;
    int right = text.length() - 1;
    while (left < right) {
        if (text[left] != text[right]) {
            return false;
        }
        left++;
        right--;
    }
    return true;
}

