// Helper function for Exponentiation by Squaring
long long power(long long base, int exp, int mod) {
    if (exp == 0) return 1;
    long long half = power(base, exp / 2, mod);
    long long result = (half * half) % mod;
    if (exp % 2 == 1) result = (result * base) % mod;
    return result;
}

int modp(int n, int p) {
    if (n == 0) return 1;
    return power(2, n, p);
}


#undef NDEBUG
#include<assert.h>
int main(){
    assert (modp(3, 5) == 3);
    assert (modp(1101, 101) == 2);
    assert (modp(0, 101) == 1);
    assert (modp(3, 11) == 8);
    assert (modp(100, 101) == 1);
    assert (modp(30, 5) == 4);
    assert (modp(31, 5) == 3);
}

