#include <stdexcept>

int modp(int n, int p) {
    // Input validation
    if (p <= 0) {
        throw std::invalid_argument("Modulus p must be a positive integer.");
    }

    // Edge cases
    if (n == 0) {
        return 1;
    }
    if (p == 1) {
        return 0;
    }

    // Exponentiation by squaring
    int result = 1;
    int base = 2;
    while (n > 0) {
        if (n % 2 == 1) {
            result = (result * base) % p;
        }
        base = (base * base) % p;
        n /= 2;
    }

    return result;
}

