int fib(int n) {
    if (n < 0) {
        throw invalid_argument("Input must be a non-negative integer.");
    }

    static unordered_map<int, int> memo;

    if (n == 0) return 0;
    if (n == 1) return 1;

    if (memo.find(n) != memo.end()) {
        return memo[n];
    }

    memo[n] = fib(n - 1) + fib(n - 2);
    return memo[n];
}


