bool correct_bracketing(string brackets) {
    int balance = 0;

    for (char bracket : brackets) {
        if (bracket == '(') {
            balance++;
        } else if (bracket == ')') {
            balance--;
        }

        // If balance goes negative, there's an unmatched closing bracket
        if (balance < 0) {
            return false;
        }
    }

    // If balance is zero, all brackets are matched
    return balance == 0;
}

