vector<int> pluck(vector<int> arr) {
    if (arr.empty()) {
        return {};
    }

    int smallestEven = INT_MAX;
    int smallestIndex = -1;

    for (int i = 0; i < arr.size(); ++i) {
        if (arr[i] % 2 == 0) {
            if (arr[i] < smallestEven || (arr[i] == smallestEven && i < smallestIndex)) {
                smallestEven = arr[i];
                smallestIndex = i;
            }
        }
    }

    if (smallestIndex == -1) {
        return {};
    }

    return {smallestEven, smallestIndex};
}

