vector<int> strange_sort_list(vector<int> lst) {
    // Step 1: Sort the input vector
    sort(lst.begin(), lst.end());

    // Step 2: Initialize result vector and pointers
    vector<int> result;
    int start = 0;
    int end = lst.size() - 1;

    // Step 3: Alternating extraction
    while (start <= end) {
        if (start <= end) {
            result.push_back(lst[start]);
            start++;
        }
        if (start <= end) {
            result.push_back(lst[end]);
            end--;
        }
    }

    // Step 4: Return the result vector
    return result;
}

