// Helper function to check if the vector is palindromic
bool is_palindromic(vector<int> q) {
    int n = q.size();
    for (int i = 0; i < n / 2; ++i) {
        if (q[i] != q[n - i - 1]) {
            return false;
        }
    }
    return true;
}

// Helper function to calculate the sum of the vector elements
int sum_of_elements(vector<int> q) {
    int sum = 0;
    for (int num : q) {
        sum += num;
    }
    return sum;
}

// Helper function to check if the sum is within the limit
bool is_sum_within_limit(int sum, int w) {
    return sum <= w;
}

