bool will_it_fly(vector<int> q, int w) {
    // Input validation (optional, depending on requirements)
    if (q.empty() || w <= 0) {
        return false;
    }

    // Check if the vector is palindromic
    bool is_balanced = is_palindromic(q);

    // Calculate the sum of the vector elements
    int sum = sum_of_elements(q);

    // Check if the sum is within the limit
    bool is_light_enough = is_sum_within_limit(sum, w);

    // Combine the results
    return is_balanced && is_light_enough;
}

