        }
    }

    // Step 4: Finding the Maximum Valid Integer
    if (validIntegers.empty()) {
        return -1; // Step 5: Edge Case Handling
    }

    int maxValidInteger = *std::max_element(validIntegers.begin(), validIntegers.end());

    // Step 6: Output the Result
    return maxValidInteger;
}

