// Function to generate primes less than 100 using Sieve of Eratosthenes
std::vector<int> generatePrimes() {
    std::vector<bool> isPrime(100, true);
    isPrime[0] = isPrime[1] = false;
    for (int i = 2; i * i < 100; ++i) {
        if (isPrime[i]) {
            for (int j = i * i; j < 100; j += i) {
                isPrime[j] = false;
            }
        }
    }
    std::vector<int> primes;
    for (int i = 2; i < 100; ++i) {
        if (isPrime[i]) primes.push_back(i);
    }
    return primes;
}

// Function to check if a number is the product of exactly three primes
bool is_multiply_prime(int a) {
    if (a < 8) return false; // Smallest product of three primes is 30

    std::vector<int> primes = generatePrimes();
    std::vector<int> factors;

    for (int prime : primes) {
        while (a % prime == 0) {
            factors.push_back(prime);
            a /= prime;
        }
    }

    if (a > 1) return false; // If a is still greater than 1, it means it has a prime factor greater than 100

    return factors.size() == 3;
}

