    for (int i = 2; i < 100; ++i) {
        if (isPrime[i]) {
            primes.push_back(i);
            for (int j = i * i; j < 100; j += i) {
                isPrime[j] = false;
            }
        }
    }
    return primes;
}

// Function to factorize the given number using the list of prime numbers
std::vector<int> factorize(int a, const std::vector<int>& primes) {
    std::vector<int> factors;
    for (int prime : primes) {
        if (a % prime == 0) {
            factors.push_back(prime);
            while (a % prime == 0) {
                a /= prime;
            }
        }
        if (a == 1) break;
    }
    return factors;
}

// Function to count the number of unique prime factors
int countUniquePrimeFactors(const std::vector<int>& factors) {
    std::unordered_set<int> uniqueFactors(factors.begin(), factors.end());
    return uniqueFactors.size();
}

// Main function to determine if the number is a multiplication of 3 prime numbers
bool is_multiply_prime(int a) {
    if (a < 2) return false; // A number less than 2 cannot be a product of 3 primes

    std::vector<int> primes = generatePrimes();
    std::vector<int> factors = factorize(a, primes);
    int uniqueFactorCount = countUniquePrimeFactors(factors);

    return uniqueFactorCount == 3;
}

