// Helper function to calculate the total number of characters in a vector of strings
int calculate_total_chars(const vector<string>& lst) {
    int total = 0;
    for (const string& str : lst) {
        total += str.length();
    }
    return total;
}

// Main function to compare two vectors of strings
vector<string> total_match(const vector<string>& lst1, const vector<string>& lst2) {
    int total_chars_lst1 = calculate_total_chars(lst1);
    int total_chars_lst2 = calculate_total_chars(lst2);

    if (total_chars_lst1 < total_chars_lst2) {
        return lst1;
    } else if (total_chars_lst2 < total_chars_lst1) {
        return lst2;
    } else {
        return lst1; // If both have the same number of characters, return the first vector
    }
}

