        while (decimal > 0) {
            binary_str += (decimal % 2 == 0) ? '0' : '1';
            decimal /= 2;
        }
        std::reverse(binary_str.begin(), binary_str.end());
    }

    // Step 2: Format the binary string
    std::string formatted_str = "db" + binary_str + "db";

    // Step 3: Return the result
    return formatted_str;
}

