// Function to check if a number is prime
bool is_prime(int n) {
    if (n <= 1) return false;
    if (n <= 3) return true;
    if (n % 2 == 0 || n % 3 == 0) return false;
    for (int i = 5; i * i <= n; i += 6) {
        if (n % i == 0 || n % (i + 2) == 0) return false;
    }
    return true;
}

// Main function to count prime hexadecimal digits
int hex_key(string num) {
    // Set of prime hexadecimal digits
    unordered_set<char> prime_hex_digits = {'2', '3', '5', '7', 'B', 'D'};

    int count = 0;

    for (char c : num) {
        if (prime_hex_digits.find(c) != prime_hex_digits.end()) {
            int decimal_value;
            if (c >= '0' && c <= '9') {
                decimal_value = c - '0';
            } else {
                decimal_value = 10 + (c - 'A');
            }
            if (is_prime(decimal_value)) {
                count++;
            }
        }
    }

    return count;
}

