    std::string N_str = std::to_string(N);
    int sum = 0;
    for (char digit : N_str) {
        sum += digit - '0'; // Convert char to int
    }

    // Step 2: Binary Conversion
    std::string binary_sum = std::bitset<32>(sum).to_string();

    // Remove leading zeros
    size_t pos = binary_sum.find_first_not_of('0');
    if (pos != std::string::npos) {
        binary_sum = binary_sum.substr(pos);
    } else {
        binary_sum = "0"; // In case sum is 0
    }

    // Step 3: Return the Binary String
    return binary_sum;
}

