// Function to rotate a single character by 4 places
char rotateCharacter(char c) {
    if (c >= 'a' && c <= 'z') {
        return 'a' + (c - 'a' + 4) % 26;
    } else if (c >= 'A' && c <= 'Z') {
        return 'A' + (c - 'A' + 4) % 26;
    } else {
        return c; // Non-alphabet characters remain unchanged
    }
}

// Main encryption function
string encrypt(string s) {
    string result = "";
    for (char c : s) {
        result += rotateCharacter(c);
    }
    return result;
}

