    if (array.empty() || array.size() == 1) {
        return array;
    }

    int first_element = array.front();
    int last_element = array.back();
    int sum = first_element + last_element;

    bool ascending = (sum % 2 != 0); // True if sum is odd, False if sum is even

    vector<int> sorted_array = array; // Create a copy
    if (ascending) {
        sort(sorted_array.begin(), sorted_array.end());
    } else {
        sort(sorted_array.begin(), sorted_array.end(), greater<int>());
    }

    return sorted_array;
}

