// Helper function to convert a single GPA to a letter grade
string convert_gpa_to_letter_grade(float gpa) {
    if (gpa == 4.0) return "A+";
    else if (gpa > 3.7) return "A";
    else if (gpa > 3.3) return "A-";
    else if (gpa > 3.0) return "B+";
    else if (gpa > 2.7) return "B";
    else if (gpa > 2.3) return "B-";
    else if (gpa > 2.0) return "C+";
    else if (gpa > 1.7) return "C";
    else if (gpa > 1.3) return "C-";
    else if (gpa > 1.0) return "D+";
    else if (gpa > 0.7) return "D";
    else if (gpa > 0.0) return "D-";
    else return "E";
}

// Main function to convert a vector of GPAs to a vector of letter grades
vector<string> numerical_letter_grade(vector<float> grades) {
    vector<string> letter_grades;
    for (float gpa : grades) {
        letter_grades.push_back(convert_gpa_to_letter_grade(gpa));
    }
    return letter_grades;
}

