// Function to check if a number is prime
bool isPrime(int num) {
    if (num < 2) return false;
    for (int i = 2; i * i <= num; ++i) {
        if (num % i == 0) return false;
    }
    return true;
}

// Function to calculate the sum of digits of a number
int sumOfDigits(int num) {
    int sum = 0;
    while (num > 0) {
        sum += num % 10;
        num /= 10;
    }
    return sum;
}

// Main function to solve the problem
int skjkasdkd(vector<int> lst) {
    int largestPrime = -1;

    // Step 1: Identify prime numbers in the vector
    for (int num : lst) {
        if (isPrime(num)) {
            if (num > largestPrime) {
                largestPrime = num;
            }
        }
    }

    // Step 2: If no prime found, return 0 (or handle as needed)
    if (largestPrime == -1) return 0;

    // Step 3: Calculate the sum of digits of the largest prime
    return sumOfDigits(largestPrime);
}

