int is_bored(std::string S) {
    std::vector<std::string> sentences;
    std::stringstream ss(S);
    std::string sentence;
    int boredom_count = 0;

    // Step 3: Split the input string into sentences
    while (std::getline(ss, sentence, '.')) {
        sentences.push_back(sentence);
    }

    // Step 5: Iterate through each sentence
    for (const auto& s : sentences) {
        // Step 6: Check if the sentence starts with "I"
        if (s.find("I ") == 0 || s == "I") {
            // Step 7: Increment the boredom counter
            boredom_count++;
        }
    }

    // Step 8: Return the boredom counter
    return boredom_count;
}


