std::string rounded_avg(int n, int m) {
    // Step 1: Input Validation
    if (n > m) {
        return "-1";
    }

    // Step 2: Calculate the Average
    int sum = 0;
    for (int i = n; i <= m; ++i) {
        sum += i;
    }
    int count = m - n + 1;
    double average = static_cast<double>(sum) / count;

    // Step 3: Round the Average
    int rounded_average = static_cast<int>(floor(average));

    // Step 4: Convert to Binary
    std::string binary_representation = std::bitset<32>(rounded_average).to_string();
    binary_representation = binary_representation.erase(0, binary_representation.find_first_not_of('0'));

    // Step 5: Return the Result
    return binary_representation;
}


