string exchange(vector<int> lst1, vector<int> lst2) {
    // Step 1: Count odd elements in lst1
    int oddCountLst1 = 0;
    for (int num : lst1) {
        if (num % 2 != 0) {
            oddCountLst1++;
        }
    }

    // Step 2: Count even elements in lst2
    int evenCountLst2 = 0;
    for (int num : lst2) {
        if (num % 2 == 0) {
            evenCountLst2++;
        }
    }

    // Step 3: Compare counts and return result
    if (evenCountLst2 >= oddCountLst1) {
        return "YES";
    } else {
        return "NO";
    }
}

