int max_fill(vector<vector<int>> grid, int capacity) {
    int total_lowerings = 0;

    // Iterate over each well (row in the grid)
    for (const auto& well : grid) {
        int water_in_well = 0;

        // Calculate the total amount of water in the well
        for (int unit : well) {
            water_in_well += unit;
        }

        // Calculate the number of times the bucket needs to be lowered
        int lowerings_for_well = (water_in_well + capacity - 1) / capacity; // Integer division rounding up
        total_lowerings += lowerings_for_well;
    }

    return total_lowerings;
}

