int count_water_units(const vector<int>& row) {
    int count = 0;
    for (int unit : row) {
        if (unit == 1) count++;
    }
    return count;
}

int calculate_lowerings(int water_units, int capacity) {
    return (water_units + capacity - 1) / capacity; // Integer division with ceiling
}

