vector<string> reverse_delete(string s, string c) {
    // Step 2.1: Initialize an empty string to store the result of the deletion
    string result;

    // Step 2.2: Iterate through each character in s
    for (char ch : s) {
        // Step 2.3: Check if the character is present in c
        if (c.find(ch) == string::npos) {
            // Step 2.4: If the character is not in c, append it to the result string
            result += ch;
        }
    }

    // Step 3.1: Reverse the resulting string from the deletion step
    string reversed_result = result;
    reverse(reversed_result.begin(), reversed_result.end());

    // Step 3.2: Compare the original string with its reversed version
    bool is_palindrome = (result == reversed_result);

    // Step 4.1: Create a vector of strings
    vector<string> result_vector;

    // Step 4.2: Add the resulting string from the deletion step as the first element
    result_vector.push_back(result);

    // Step 4.3: Add "True" or "False" based on the palindrome check as the second element
    result_vector.push_back(is_palindrome ? "True" : "False");

    // Step 5.1: Return the vector containing the result string and the palindrome check result
    return result_vector;
}

