    if (open1 + open2 != close1 + close2) return "No";

    // Concatenate the strings in both possible orders and check for balance
    string concat1 = lst[0] + lst[1];
    string concat2 = lst[1] + lst[0];

    if (is_balanced(concat1) || is_balanced(concat2)) return "Yes";

    return "No";
}

