int triHelper(int n) {
    if (n == 1) return 3;
    if (n % 2 == 0) return 1 + n / 2;
    if (memo[n] != -1) return memo[n];

    memo[n] = triHelper(n - 1) + triHelper(n - 2) + triHelper(n + 1);
    return memo[n];
}

vector<int> generateTribonacciSequence(int n) {
    vector<int> sequence(n + 1);
    for (int i = 1; i <= n + 1; ++i) {
        sequence[i - 1] = triHelper(i);
    }
    return sequence;
}

