vector<int> tri(int n) {
    if (n < 1) return {}; // Handle edge case where n is less than 1

    vector<int> sequence(n + 1);
    sequence[1] = 3; // Base case

    for (int i = 2; i <= n; ++i) {
        if (i % 2 == 0) {
            sequence[i] = 1 + i / 2;
        } else {
            // Handle the recursive case for odd i
            if (i + 1 <= n) {
                sequence[i] = sequence[i - 1] + sequence[i - 2] + sequence[i + 1];
            } else {
                // If i + 1 is out of bounds, use the even formula for i + 1
                sequence[i] = sequence[i - 1] + sequence[i - 2] + (1 + (i + 1) / 2);
            }
        }
    }

    return sequence;
}

