vector<int> minPath(vector<vector<int>> grid, int k) {
    int N = grid.size();
    vector<int> min_path;
    vector<int> current_path;

    // Helper function to generate paths
    function<void(int, int, int)> generatePaths = [&](int x, int y, int length) {
        if (length == k) {
            if (min_path.empty() || lexicographical_compare(current_path.begin(), current_path.end(), min_path.begin(), min_path.end())) {
                min_path = current_path;
            }
            return;
        }

        // Explore neighbors
        int dx[] = {0, 0, 1, -1};
        int dy[] = {1, -1, 0, 0};
        for (int i = 0; i < 4; ++i) {
            int nx = x + dx[i];
            int ny = y + dy[i];
            if (nx >= 0 && nx < N && ny >= 0 && ny < N) {
                current_path.push_back(grid[nx][ny]);
                generatePaths(nx, ny, length + 1);
                current_path.pop_back();
            }
        }
    };

    // Start generating paths from each cell
    for (int i = 0; i < N; ++i) {
        for (int j = 0; j < N; ++j) {
            current_path.clear();
            current_path.push_back(grid[i][j]);
            generatePaths(i, j, 1);
        }
    }

    return min_path;
}

