class Path {
public:
    vector<int> values;
    bool operator<(const Path& other) const {
        return values < other.values;
    }
};

vector<pair<int, int>> getNeighbors(int x, int y, int N) {
    vector<pair<int, int>> neighbors;
    if (x > 0) neighbors.push_back({x - 1, y});
    if (x < N - 1) neighbors.push_back({x + 1, y});
    if (y > 0) neighbors.push_back({x, y - 1});
    if (y < N - 1) neighbors.push_back({x, y + 1});
    return neighbors;
}

void generatePaths(vector<vector<int>>& grid, int k, int x, int y, Path& currentPath, vector<Path>& allPaths) {
    currentPath.values.push_back(grid[x][y]);
    if (currentPath.values.size() == k) {
        allPaths.push_back(currentPath);
    } else {
        for (auto& neighbor : getNeighbors(x, y, grid.size())) {
            generatePaths(grid, k, neighbor.first, neighbor.second, currentPath, allPaths);
        }
    }
    currentPath.values.pop_back();
}

Path minPath(vector<Path>& allPaths) {
    Path minPath = allPaths[0];
    for (const auto& path : allPaths) {
        if (path < minPath) {
            minPath = path;
        }
    }
    return minPath;
}

vector<int> minPath(vector<vector<int>> grid, int k) {
    vector<Path> allPaths;
    int N = grid.size();
    for (int i = 0; i < N; ++i) {
        for (int j = 0; j < N; ++j) {
            Path currentPath;
            generatePaths(grid, k, i, j, currentPath, allPaths);
        }
    }
    return minPath(allPaths).values;
}

