// Function to generate all possible paths of length k starting from a given cell
void generatePaths(vector<vector<int>>& grid, int k, int x, int y, vector<int>& currentPath, vector<vector<int>>& allPaths) {
    // Base case: if the path length is k, add it to allPaths
    if (currentPath.size() == k) {
        allPaths.push_back(currentPath);
        return;
    }

    // Move in all 4 possible directions (up, down, left, right)
    int dx[] = {0, 0, 1, -1};
    int dy[] = {1, -1, 0, 0};
    for (int i = 0; i < 4; ++i) {
        int nx = x + dx[i];
        int ny = y + dy[i];
        if (nx >= 0 && nx < grid.size() && ny >= 0 && ny < grid[0].size()) {
            currentPath.push_back(grid[nx][ny]);
            generatePaths(grid, k, nx, ny, currentPath, allPaths);
            currentPath.pop_back();
        }
    }
}

// Function to find the minimum path of length k in the grid
vector<int> minPath(vector<vector<int>> grid, int k) {
    int N = grid.size();
    vector<vector<int>> allPaths;

    // Generate all possible paths starting from each cell
    for (int i = 0; i < N; ++i) {
        for (int j = 0; j < N; ++j) {
            vector<int> currentPath = {grid[i][j]};
            generatePaths(grid, k, i, j, currentPath, allPaths);
        }
    }

    // Find the lexicographically smallest path
    vector<int> minPath = allPaths[0];
    for (const auto& path : allPaths) {
        if (path < minPath) {
            minPath = path;
        }
    }

    return minPath;
}

