// Function to get valid neighbors of a cell
vector<pair<int, int>> getNeighbors(const vector<vector<int>>& grid, pair<int, int> cell) {
    vector<pair<int, int>> neighbors;
    int N = grid.size();
    int x = cell.first, y = cell.second;
    if (x > 0) neighbors.push_back({x - 1, y});
    if (x < N - 1) neighbors.push_back({x + 1, y});
    if (y > 0) neighbors.push_back({x, y - 1});
    if (y < N - 1) neighbors.push_back({x, y + 1});
    return neighbors;
}

// Function to compare two paths lexicographically
bool isLexicographicallySmaller(const vector<int>& pathA, const vector<int>& pathB) {
    return pathA < pathB;
}

// Recursive function to generate paths
void generatePaths(const vector<vector<int>>& grid, pair<int, int> currentCell, int k, vector<int>& currentPath, vector<int>& minPath) {
    if (k == 0) {
        if (minPath.empty() || isLexicographicallySmaller(currentPath, minPath)) {
            minPath = currentPath;
        }
        return;
    }

    vector<pair<int, int>> neighbors = getNeighbors(grid, currentCell);
    for (const auto& neighbor : neighbors) {
        int x = neighbor.first, y = neighbor.second;
        currentPath.push_back(grid[x][y]);
        generatePaths(grid, neighbor, k - 1, currentPath, minPath);
        currentPath.pop_back();
    }
}

vector<int> minPath(vector<vector<int>> grid, int k) {
    vector<int> minPath;
    int N = grid.size();

    // Iterate over all starting cells
    for (int i = 0; i < N; ++i) {
        for (int j = 0; j < N; ++j) {
            vector<int> currentPath = {grid[i][j]};
            generatePaths(grid, {i, j}, k - 1, currentPath, minPath);
        }
    }

    return minPath;
}

