// Function to get valid neighboring cells
vector<pair<int, int>> getNeighbors(vector<vector<int>> grid, pair<int, int> cell) {
    vector<pair<int, int>> neighbors;
    int N = grid.size();
    int x = cell.first, y = cell.second;
    if (x > 0) neighbors.push_back({x - 1, y});
    if (x < N - 1) neighbors.push_back({x + 1, y});
    if (y > 0) neighbors.push_back({x, y - 1});
    if (y < N - 1) neighbors.push_back({x, y + 1});
    return neighbors;
}

// Function to generate all possible paths of length k starting from startCell
void generatePaths(vector<vector<int>> grid, pair<int, int> startCell, int k, vector<int> currentPath, vector<vector<int>>& allPaths) {
    if (k == 0) {
        allPaths.push_back(currentPath);
        return;
    }
    int x = startCell.first, y = startCell.second;
    currentPath.push_back(grid[x][y]);
    for (auto neighbor : getNeighbors(grid, startCell)) {
        generatePaths(grid, neighbor, k - 1, currentPath, allPaths);
    }
}

// Function to compare two paths lexicographically
bool isLexicographicallySmaller(vector<int> pathA, vector<int> pathB) {
    for (int i = 0; i < pathA.size(); ++i) {
        if (pathA[i] < pathB[i]) return true;
        if (pathA[i] > pathB[i]) return false;
    }
    return false;
}

// Main function to find the minimum path of length k
vector<int> minPath(vector<vector<int>> grid, int k) {
    vector<vector<int>> allPaths;
    int N = grid.size();
    for (int i = 0; i < N; ++i) {
        for (int j = 0; j < N; ++j) {
            generatePaths(grid, {i, j}, k, {}, allPaths);
        }
    }
    vector<int> smallestPath = allPaths[0];
    for (auto path : allPaths) {
        if (isLexicographicallySmaller(path, smallestPath)) {
            smallestPath = path;
        }
    }
    return smallestPath;
}

