bool is_nested(string str) {
    // Step 1: Input Validation
    for (char c : str) {
        if (c != '[' && c != ']') {
            return false;
        }
    }

    // Step 2: Stack-Based Traversal
    stack<char> s;
    for (char c : str) {
        if (c == '[') {
            s.push(c);
        } else if (c == ']') {
            if (s.empty()) {
                continue; // Invalid subsequence
            }
            s.pop();
            if (s.size() > 0) {
                return true; // Nested brackets found
            }
        }
    }

    // Step 3: Final Check
    return false;
}

