}

bool valid_date(string date) {
    // Step 1: Input Parsing and Format Check
    if (date.length() != 10 || date[2] != '-' || date[5] != '-') {
        return false;
    }

    string mm = date.substr(0, 2);
    string dd = date.substr(3, 2);
    string yyyy = date.substr(6, 4);

    // Convert strings to integers
    int month, day, year;
    try {
        month = stoi(mm);
        day = stoi(dd);
        year = stoi(yyyy);
    } catch (const invalid_argument&) {
        return false;
    }

    // Step 2: Month Validation
    if (month < 1 || month > 12) {
        return false;
    }

    // Step 3: Day Validation
    bool valid_day = false;
    if (month == 2) {
        // February
        if (is_leap_year(year)) {
            valid_day = (day >= 1 && day <= 29);
