#include <algorithm>
using namespace std;

const vector<string> planets = {"Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"};

bool isValidPlanet(const string& planet) {
    return find(planets.begin(), planets.end(), planet) != planets.end();
}

int getPlanetIndex(const string& planet) {
    return find(planets.begin(), planets.end(), planet) - planets.begin();
}

void ensureOrder(string& planet1, string& planet2) {
    int index1 = getPlanetIndex(planet1);
    int index2 = getPlanetIndex(planet2);
    if (index1 > index2) {
        swap(planet1, planet2);
    }
}

vector<string> collectPlanetsBetween(const string& planet1, const string& planet2) {
    vector<string> result;
    int startIndex = getPlanetIndex(planet1);
    int endIndex = getPlanetIndex(planet2);
    for (int i = startIndex + 1; i < endIndex; ++i) {
        result.push_back(planets[i]);
    }
    return result;
}

vector<string> bf(string planet1, string planet2) {
    if (!isValidPlanet(planet1) || !isValidPlanet(planet2)) {
        return {};
    }
    ensureOrder(planet1, planet2);
    return collectPlanetsBetween(planet1, planet2);
}

