}

// Main function to sort the vector based on the sum of digits
vector<int> order_by_points(vector<int> nums) {
    if (nums.empty()) return {};

    // Create a vector of pairs (integer, sum of digits)
    vector<pair<int, int>> num_sum_pairs;
    for (int i = 0; i < nums.size(); ++i) {
        num_sum_pairs.push_back({nums[i], sum_of_digits(nums[i])});
    }

