// Helper function to calculate the sum of digits
int sum_of_digits(int num) {
    int sum = 0;
    bool is_negative = num < 0;
    num = abs(num);
    while (num > 0) {
        sum += num % 10;
        num /= 10;
    }
    return is_negative ? -sum : sum;
}

vector<int> order_by_points(vector<int> nums) {
    if (nums.empty()) return {};

    // Create a vector of pairs to store the integer and its sum of digits
    vector<pair<int, int>> num_sum_pairs;
    for (int num : nums) {
        num_sum_pairs.push_back({num, sum_of_digits(num)});
    }

    // Sort the vector of pairs based on the sum of digits (stable sort)
    stable_sort(num_sum_pairs.begin(), num_sum_pairs.end(), [](const pair<int, int>& a, const pair<int, int>& b) {
        return a.second < b.second;
    });

    // Extract the sorted integers from the data structure and return them as a new vector
    vector<int> sorted_nums;
    for (const auto& pair : num_sum_pairs) {
        sorted_nums.push_back(pair.first);
    }

    return sorted_nums;
}

