// Data structure to store the integer, sum of digits, and original index
struct NumInfo {
    int num;
    int sum_of_digits;
    int original_index;
};

// Custom comparator for sorting
bool compare_num_info(const NumInfo& a, const NumInfo& b) {
    if (a.sum_of_digits != b.sum_of_digits) {
        return a.sum_of_digits < b.sum_of_digits;
    }
    return a.original_index < b.original_index;
}

vector<int> order_by_points(vector<int> nums) {
    if (nums.empty()) {
        return {};
    }

    vector<NumInfo> num_info_list;
    for (int i = 0; i < nums.size(); ++i) {
        num_info_list.push_back({nums[i], sum_of_digits(nums[i]), i});
    }

    sort(num_info_list.begin(), num_info_list.end(), compare_num_info);

    vector<int> sorted_nums;
    for (const auto& info : num_info_list) {
        sorted_nums.push_back(info.num);
    }

    return sorted_nums;
}

