// Helper function to calculate the sum of digits
int calculate_digit_sum(int num) {
    int sum = 0;
    bool is_negative = num < 0;
    num = abs(num);
    while (num > 0) {
        sum += num % 10;
        num /= 10;
    }
    return is_negative ? -sum : sum;
}

// Main function to order the vector by digit sum
vector<int> order_by_points(vector<int> nums) {
    if (nums.empty()) return {};

    // Create a vector of pairs (original index, digit sum)
    vector<pair<int, int>> indexed_nums;
    for (size_t i = 0; i < nums.size(); ++i) {
        indexed_nums.push_back({i, calculate_digit_sum(nums[i])});
    }

    // Sort based on digit sum, and by original index if sums are equal
    sort(indexed_nums.begin(), indexed_nums.end(), [](const pair<int, int>& a, const pair<int, int>& b) {
        if (a.second == b.second) return a.first < b.first;
        return a.second < b.second;
    });

    // Create the result vector based on the sorted indices
    vector<int> result(nums.size());
    for (size_t i = 0; i < indexed_nums.size(); ++i) {
        result[i] = nums[indexed_nums[i].first];
    }

    return result;
}

