bool right_angle_triangle(float a, float b, float c) {
    // Step 1: Input Validation
    if (a + b <= c || a + c <= b || b + c <= a) {
        return false;
    }

    // Step 2: Identify the Hypotenuse
    float hypotenuse = std::max({a, b, c});
    float side1, side2;
    if (hypotenuse == a) {
        side1 = b;
        side2 = c;
    } else if (hypotenuse == b) {
        side1 = a;
        side2 = c;
    } else {
