        side2 = b;
    }

    // Step 3: Apply the Pythagorean Theorem
    float square_hypotenuse = hypotenuse * hypotenuse;
    float square_side1 = side1 * side1;
    float square_side2 = side2 * side2;

    // Step 4: Return the Result
    return (square_hypotenuse == square_side1 + square_side2);
}


