int evaluate_expression(string expression) {
    stack<int> operands;
    stack<string> operators;
    string current_number = "";

    auto apply_operator = [&]() {
        string op = operators.top();
        operators.pop();
        int b = operands.top();
        operands.pop();
        int a = operands.top();
        operands.pop();
        if (op == "+") operands.push(a + b);
        else if (op == "-") operands.push(a - b);
        else if (op == "*") operands.push(a * b);
        else if (op == "//") operands.push(a / b);
        else if (op == "**") operands.push(pow(a, b));
    };

    for (char ch : expression) {
        if (isdigit(ch)) {
            current_number += ch;
        } else {
            if (!current_number.empty()) {
                operands.push(stoi(current_number));
                current_number = "";
            }
            string op(1, ch);
            while (!operators.empty() && 
                   ((op == "+" || op == "-") && (operators.top() == "*" || operators.top() == "//" || operators.top() == "**")) ||
                   ((op == "*" || op == "//") && (operators.top() == "**"))) {
                apply_operator();
            }
            operators.push(op);
        }
    }
    if (!current_number.empty()) {
        operands.push(stoi(current_number));
    }
    while (!operators.empty()) {
        apply_operator();
    }

    return operands.top();
}


