        operands.pop();
        if (op == "+") operands.push(a + b);
        else if (op == "-") operands.push(a - b);
        else if (op == "*") operands.push(a * b);
        else if (op == "/") {
            if (b == 0) throw runtime_error("Division by zero.");
            operands.push(a / b);
        }
        else if (op == "**") operands.push(pow(a, b));
    }

    return operands.top();
}

