int evaluateExpression(const std::string& expression);

int do_algebra(std::vector<std::string> operators, std::vector<int> operands) {
    // Step 1: Input Validation
    if (operators.size() != operands.size() - 1) {
        throw std::invalid_argument("Invalid input: operator and operand vector lengths do not match.");
    }
    for (int operand : operands) {
        if (operand < 0) {
            throw std::invalid_argument("Invalid input: operands must be non-negative integers.");
        }
    }
    for (const std::string& op : operators) {
        if (op != "+" && op != "-" && op != "*" && op != "//" && op != "**") {
            throw std::invalid_argument("Invalid input: operators must be one of '+', '-', '*', '//', '**'.");
        }
    }

    // Step 2: Expression Construction
    std::string expression;
    for (size_t i = 0; i < operators.size(); ++i) {
        expression += std::to_string(operands[i]) + " " + operators[i] + " ";
    }
    expression += std::to_string(operands.back());

    // Step 3: Expression Evaluation
    return evaluateExpression(expression);
}

int evaluateExpression(const std::string& expression) {
    std::stack<int> operands;
    std::stack<std::string> operators;
    std::string token;
    for (char ch : expression) {
        if (ch == ' ') {
            if (!token.empty()) {
                if (token == "+" || token == "-" || token == "*" || token == "//" || token == "**") {
                    operators.push(token);
                } else {
                    operands.push(std::stoi(token));
                }
                token.clear();
            }
        } else {
            token += ch;
        }
    }
    if (!token.empty()) {
        operands.push(std::stoi(token));
    }

    while (!operators.empty()) {
        std::string op = operators.top();
        operators.pop();

        int b = operands.top();
        operands.pop();
        int a = operands.top();
        operands.pop();

        if (op == "**") {
            operands.push(std::pow(a, b));
        } else if (op == "*") {
            operands.push(a * b);
        } else if (op == "//") {
            operands.push(a / b);
        } else if (op == "+") {
            operands.push(a + b);
        } else if (op == "-") {
            operands.push(a - b);
        }
    }

    return operands.top();
}

