vector<string> split_by_spaces(const string& paren_string) {
    vector<string> groups;
    istringstream stream(paren_string);
    string group;
    while (getline(stream, group, ' ')) {
        groups.push_back(group);
    }
    return groups;
}

int calculate_max_depth(const string& paren_group) {
    int max_depth = 0;
    int current_depth = 0;
    for (char ch : paren_group) {
        if (ch == '(') {
            current_depth++;
            if (current_depth > max_depth) {
                max_depth = current_depth;
            }
        } else if (ch == ')') {
            current_depth--;
        }
    }
    return max_depth;
}

vector<int> parse_nested_parens(const string& paren_string) {
    vector<string> groups = split_by_spaces(paren_string);
    vector<int> depths;
    for (const string& group : groups) {
        depths.push_back(calculate_max_depth(group));
    }
    return depths;
}

