vector<int> parse_nested_parens(string paren_string) {
    vector<int> result;
    istringstream iss(paren_string);
    string group;

    while (iss >> group) {
        int current_level = 0;
        int max_level = 0;

        for (char ch : group) {
            if (ch == '(') {
                current_level++;
                max_level = max(max_level, current_level);
            } else if (ch == ')') {
                current_level--;
            }
        }

        result.push_back(max_level);
    }

    return result;
}

