// Helper function to count the number of ones in the binary representation of an integer
int count_ones(int num) {
    int count = 0;
    while (num != 0) {
        count += num & 1;
        num >>= 1;
    }
    return count;
}

// Custom comparator function to compare two integers based on the number of ones in their binary representation
bool compare_by_ones_and_value(int a, int b) {
    int ones_a = count_ones(a);
    int ones_b = count_ones(b);
    if (ones_a == ones_b) {
        return a < b;
    }
    return ones_a < ones_b;
}

// Function to sort the vector based on the number of ones in the binary representation of its elements
vector<int> sort_array(vector<int> arr) {
    sort(arr.begin(), arr.end(), compare_by_ones_and_value);
    return arr;
}

